import { useState, useEffect } from "react";
import Layout from "../components/layout/layout";
import { getProduct } from "../server";

function Home() {
  const [product, setProduct] = useState();

  useEffect(() => {
    const identifier = { slug: "phoenix-flyers" };
    getProduct(identifier, setProduct);
  }, []);

  console.log(product);

  return (
    <Layout>
      <h2>Home</h2>
    </Layout>
  );
}

export default Home;
